oxy_webhelp_navlinks = {"N10001-d4800e4305":{"topics":[{"title":"How can I use a LAN, cable, or DSL to access Notes® mail and applications?","shortdesc":"<p class=\"shortdesc\">If your physical connection is a cable modem with a cable (television) service connection, or a digital subscriber line (DSL), HCL Notes® works as if you're on a LAN. Therefore, you can use the same or a very similar configuration for these three connection methods.<\/p>","href":"locacc_wizard_notes_mail_t.html","attributes":{"data-id":"locacc_wizard_notes_mail_t"},"menu":{"hasChildren":false},"tocID":"locacc_wizard_notes_mail_t-d4800e4313","topics":[]},{"title":"How can I use a phone line to access Notes® mail and applications?","shortdesc":"<p class=\"shortdesc\"> If your physical connection is a telephone line with a dialup (digital\/analog) modem, you need a Network Dialup location type to use HCL Notes® mail on an HCL Domino® server, in addition to remote access service (RAS) software in your operating system (such as Microsoft™ Dial-Up Networking).<\/p>","href":"locacc_wizard_ph_notes_mail_t.html","attributes":{"data-id":"locacc_wizard_ph_notes_mail_t"},"menu":{"hasChildren":false},"tocID":"locacc_wizard_ph_notes_mail_t-d4800e4330","topics":[]}]}};